import React, { Component } from 'react';
import "./Navbar.css";
import { Grid } from '@material-ui/core';
class Navbar extends Component {
    constructor(props) {
        super(props);
    }
    state = {  }
    render() { 
        return ( 
            <div>
               <Grid  container>
                <Grid item xs={3}></Grid>
                <Grid item xs={2}></Grid>
                <Grid item xs={1}></Grid>

               </Grid>
            </div>
        );
    }
}
 
export default Navbar;
